import Table from "react-bootstrap/Table"

export default function MyDiet() {
    return <ListGroup>
        <ListGroup.Item>chicken</ListGroup.Item>
        <ListGroup.Item>pork</ListGroup.Item>
        <ListGroup.Item>rice</ListGroup.Item>
    </ListGroup>
}
